import {
    DropdownButton,
    Dropdown,
    Button
} from 'react-bootstrap';
import {
    container as style_container,
    table as style_table,
    content as style_content
} from './index.module.css';

const Toolbox = ({
    year,
    type,
    search,
    button
}) => {
    return <div
        className={style_container}
    >
        <div className={style_table}>
            <div className={style_content}>
                {
                    year && year.data ?
                        <Dropdown.Divider
                            id={"dropdown-basic-button"/*year.id*/}
                            variant="primary"
                            as="button"
                            size="md"
                            title={year.title}
                        >
                            {
                                year.data.map((item, index) => {
                                    return <Dropdown.Item
                                        key={year.key+index}
                                        eventKey={index}
                                        {...item.props}
                                        
                                    >
                                        {item.value}
                                    </Dropdown.Item>
                                })
                            }
                        </Dropdown.Divider>
                    :
                        null
                }
                {
                    type && type.data ?
                        <DropdownButton id={type.id} title={type.title}>
                            {
                                type.data.map((item, index) => {
                                    return <Dropdown.Item key={type.key+index}>{item.value}</Dropdown.Item>
                                })
                            }
                        </DropdownButton>
                    :
                        null
                }
                {
                    search ?
                        <input
                            type="text"
                            value={search.value}
                            onChange={search.onChange}
                            {...search.props}
                        />
                    :
                        null
                }
                {
                    button ?
                        <Button
                            {...button}
                        />
                    :
                        null
                }
            </div>
        </div>
    </div>
};
export default Toolbox;
